import { Component } from '@angular/core';

@Component({
  selector: 'cms-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent {
  title = 'cms';
}
<cms-header></cms-header>
<div class="container">
  <div class="row">
    <div class="col-md-12">
      <cms-contacts></cms-contacts>
    </div>
  </div>
</div>
